import React, { useEffect, useState } from "react";
import Axios from "axios";
import { useParams } from "react-router-dom";

function Applicants({ id_property_ad }) {
  const [adInd, setAdInd] = useState([]);

  const { adId } = useParams();
  const [adNo, setAdNo] = useState(null);

  const getIndAd = `http://localhost:3001/advert/9`;

  useEffect(() => {
    Axios.get(getIndAd).then((response) => {
      setAdInd(response.data);
      console.log(response.data);
    });
  }, []);

  useEffect(() => {
    fetch(`http://localhost:3000/myadverts/${adId}`).then(setAdNo);
  }, [adId]);

  console.log(adNo);

  return (
    <div>
      <h1>This is your main ad</h1>

      {adInd.map((val) => {
        return (
          <div>
            Description: {val.description}
            Rent: {val.rent}
          </div>
        );
      })}
    </div>
  );
}

export default Applicants;
